<template>
  <div>
    <div class="loginBackgroundPic"></div>

    <div class="loginBox">
      <div class="boxInfoLeft">
        <div style="margin-top:10em;">
          <p class="leftTitle1">登录</p>
          <p class="leftTitle2">LOGIN</p>
        </div>
      </div>
      <div class="boxInfoRight">

        <p style="font-size:24px;margin-top:80px;">登录你的系统账户</p>

        <div class="loginFormDiv">

          <el-form
            v-model="dataForm"
            label-width="80px"
            :rules="rules"
            status-icon
          >
            <el-form-item
              class="formItem"
              label="用户"
              prop="username"
            >
              <el-input
                v-model="dataForm.username"
                placeholder="你的用户名"
              ></el-input>
            </el-form-item>
            <el-form-item
              label="密码"
              prop="pass"
            >
              <el-input
                type="password"
                autocomplete="off"
                v-model="dataForm.passwd"
                placeholder="******"
                show-password
              ></el-input>
            </el-form-item>

            <el-button
              style="font-size:20px;"
              type="success"
              @click="loginAccount"
            > > 登录</el-button>
          </el-form>

        </div>

        <div style="margin-bottom:0px;">
          <p class="helpHrefText">需要帮助？</p>
        </div>

      </div>
    </div>
  </div>
</template>

<script>
export default {
  data() {
    var validateUsername = (rule, value, callback) => {
      if (this.dataForm.username === '') {
        callback(new Error('请输入用户名'));
      } else {
        callback();
      }
    };
    var validatePass = (rule, value, callback) => {
      if (this.dataForm.passwd === '') {
        callback(new Error('请输入密码'));
      } else {
        callback();
      }
    };
    return {
      dataForm: {
        username: "",
        passwd: ""
      },
      rules: {
        username: [
          { validator: validateUsername, trigger: 'blur' }
        ],
        pass: [
          { validator: validatePass, trigger: 'blur' }
        ]
      }
    }
  },
  methods: {
    loginAccount() {
      let user = this.dataForm.username;
      let pass = this.dataForm.passwd;
      this.$axios.post("/api/account/login", { username: user, passwd: pass })
        .then(data => {
          if (data == null || data.data == null || data.data === "") {
            // 登录失败
            this.$message.error('登录失败');
          } else {
            try {
              if (data.data.id >= 0) {
                // 登录成功
                this.$message.success('登录成功！欢迎你, ' + data.data.realName);
                // 设置登录状态
                localStorage.setItem("loginFlag", "isLogin");
                this.$store.dispatch("userLogin", true);
                this.$router.push("/");
              }
            } catch (e) {
              this.$message.error('登录错误');
            }
          }
        })
    }
  }
}
</script>

